contract ArtithmeticTestContract {
    function arithmeticOps(uint256 a, uint256 b) pure external returns (uint256, uint256, uint256, uint256) {
        uint256 add = a + b;
        uint256 sub = a - b;
        uint256 mul = a * b;
        uint256 div = b != 0 ? a / b : 0;
        return (add, sub, mul, div);
    }
